@the.free.radicals are no strangers to putting in the work to get into the high alpine. Add in a boost of e-courage, and they’ll go even further - redefining where a megaride can take them. Extra batteries and a headlamp are optional. ⁣
⁣
Video By: @mindsparkcinema #RockShoxZEB

@eviealicerichards, @jolandaneff, and @jennyrissveds played a triple threat in Friday's XCC, trading off who pulled the lead group around the incredibly fast course in Snowshoe, USA. In the final lap, Evie stuck her outside line, breaking to the front for the final sprint which ended in another gold, 2nd and 3rd for Jolanda and Jenny. Sunday's XCO race will be nothing short of fast, furious, and fun to watch. Tune into @redbull TV to catch the actions. ⁣
⁣
Photos By: @andyvathis / @michalcervenyphoto #RockShox
